package main

import (
	"fmt"

	"github.com/firdasafridi/gosfile"
)

func main() {
	gosInterface, _ := gosfile.New(&gosfile.Config{
		TypeEncryption: gosfile.AES,
		Key:            "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa",
	})

	encryptionData, err := gosInterface.EncryptFromBase64(sampleBase64).ToString()
	fmt.Println(err)

	err = gosInterface.DecryptFromByte([]byte(encryptionData)).ExportTo("output.jpg")
	fmt.Println(err)
}

var sampleBase64 = `data:image/jpeg;base64,`
